  return (
    <div className="App">
      <div className="App__bar">
        <Navbar />
      </div>
      <div className="social__accounts">
        <SocialAccounts />
      </div>
      <Intro />
      <About />
      {/* <Achievements /> */}
      {/* <Experience /> */}
      {/* <Skills /> */}
      {/* <Projects /> */}
      {/* <Contact /> */}
      {/* <SocialAccounts /> */}
    </div>
  );
}

export default App;
